import React from 'react';
import "./Logo&search.css"
import Logo from "../../images/Logo.png"
import {UilSearch} from "@babel/core"

const Logo_search = ()=>{
    return(
        <div className='Logo_search'>
            <img src={Logo} alt="" />
            <div className="search">
                <input type="text"/>
            </div>
            div.search
        </div>
    )
}

export default Logo_search
